}


function Services() {
  return (
    <div className="row">
      <div className="col-4">
        <div className="list-group" id="list-tab" role="tablist">
          <ServiceName />
        </div>
      </div>
      <div className="col-8">
        <div className="tab-content" id="nav-tabContent">
        <ServiceInfo />
        </div>
      </div>
    </div> 
  ) 
}

function Home() {
  return (
    <div>
      <Test />
      <h1>We develop cycling in schools through a range of tailored programs</h1>
      <ShowServices />
    </div>
  );
}

export default Home;
